import BgImage from '../../images/bg.jpeg';  // Not necessary if you import homeObj

const Home: React.FC = () => {
  return (
    <>
      <InfoSection {...homeObjOne} />
      <InfoSection {...homeObjThree} />
      <InfoSection {...homeObjTwo} />
      <Pricing />
      <InfoSection {...homeObjFour} />
    </>
  );
};

export default Home;
